import "./header.css";
import "./footer.css";
import "./styles.css";
import "tailwindcss/tailwind.css";
import Navbar from "./components/Navbar";
import Accueil from "./components/Navbar";


document.documentElement.style.fontFamily = "'Mina-Regular', sans-serif";

export default function App() {
  return (
    <div className="App flex flex-col">
      <Navbar />
      <Accueil />
      <Footer />
    </div>
  );
}

function Footer() {
  return (
    <footer className="bg-purple bottom-0 text-white p-2">
      &copy; Tous droits réservés PetMeeting 2024
    </footer>
  );
}
